import { Switch, Route, NavLink } from 'react-router-dom';
// import Navigation from '../Navigation/Navigation';
// import MenuToggle from '../MenuToggle/MenuToggle';
import './Header.css';
import logo from '../../images/logo.svg';

function Header({ className = "header" }) {
  return (
    <header className={className}>
      <img className="header__logo" src={logo} alt="Лого"/>
      <Switch>
        <Route exact path="/">
          {/* <Navigation className="header__nav"> */}
            <NavLink to="/signup" className="link header__nav-item">
              Регистрация
            </NavLink>
            <NavLink to="/signin" className="link header__nav-item">
              <button className="button header__button">
                Войти
              </button>
            </NavLink>
          {/* </Navigation> */}
        </Route>
        <Route exact path="/movies">
          {/* <MenuToggle /> */}
          {/* <Navigation className="header__nav"> */}
            <NavLink to="/signup" className="link header__nav-item">
              Регистрация
            </NavLink>
            <NavLink to="/signin" className="link header__nav-item">
              <button className="button header__button">Войти</button>
            </NavLink>
          {/* </Navigation> */}
          <div className="header__overlay" />
        </Route>
      </Switch>
    </header>
  );
}

export default Header;
